import React, { Component } from "react";

class HeaderNav extends Component {
  state = {
    links: [
      "History",
      "Skillset",
      "Interests",
      "Projects",
      "Future Projects"
    ]
  };
  render() {
    const aStyle={
        width:`calc(100vw / ${this.state.links.length})`
    }
    return (
      <div className="flex-column">
        <div className="flex-row header-nav">
          <a className="flex-row nav-link pgerspach" href="#">
            P. Gerspach
          </a>
          {this.state.links.map(linkName => (
            <a
                style={aStyle}
              className={`nav-link ${linkName
                .toLowerCase()
                .replace(/\s/, "-")}`}
              href="#"
            >
              {linkName}
            </a>
          ))}
        </div>
      </div>
    );
  }
}
export default HeaderNav;
